package com.tuisitang.modules.shop.entity;import java.io.Serializable;import org.apache.commons.lang3.builder.ToStringBuilder;import net.jeeshop.core.dao.page.PagerModel;/**     * @{#} Ordership.java    *     * Ordership Entity   * * <p>Copyright: Copyright(c) 2013 </p>  * <p>Company: TST</p> * @version 1.0 * @author <a href="mailto:paninxb@gmail.com">panin</a>    */public class Ordership extends PagerModel<Ordership> implements Serializable {	private static final long serialVersionUID = 1L;	protected Long id;	private Long orderid;	private Long addressId;	private String shipname;	private String shipaddress;	private String province;	private String provinceCode;	private String city;	private String cityCode;	private String area;	private String areaCode;	private String phone;	private String tel;	private String zip;	private String sex;	private String remark;	public Ordership() {		super();	}	public Ordership(Long orderid) {		this.orderid = orderid;	}	public void clear() {		super.clear();		id = null;		orderid = null;		shipname = null;		shipaddress = null;		province = null;		provinceCode = null;		city = null;		cityCode = null;		area = null;		areaCode = null;		phone = null;		tel = null;		zip = null;		sex = null;		remark = null;	}	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public Long getOrderid() {		return orderid;	}	public void setOrderid(Long orderid) {		this.orderid = orderid;	}		public Long getAddressId() {		return addressId;	}	public void setAddressId(Long addressId) {		this.addressId = addressId;	}	public String getShipname() {		return shipname;	}	public void setShipname(String shipname) {		this.shipname = shipname;	}	public String getShipaddress() {		return shipaddress;	}	public void setShipaddress(String shipaddress) {		this.shipaddress = shipaddress;	}	public String getProvince() {		return province;	}	public void setProvince(String province) {		this.province = province;	}	public String getCity() {		return city;	}	public void setCity(String city) {		this.city = city;	}	public String getArea() {		return area;	}	public void setArea(String area) {		this.area = area;	}	public String getPhone() {		return phone;	}	public void setPhone(String phone) {		this.phone = phone;	}	public String getTel() {		return tel;	}	public void setTel(String tel) {		this.tel = tel;	}	public String getZip() {		return zip;	}	public void setZip(String zip) {		this.zip = zip;	}	public String getSex() {		return sex;	}	public void setSex(String sex) {		this.sex = sex;	}	public String getRemark() {		return remark;	}	public void setRemark(String remark) {		this.remark = remark;	}	public String getProvinceCode() {		return provinceCode;	}	public void setProvinceCode(String provinceCode) {		this.provinceCode = provinceCode;	}	public String getCityCode() {		return cityCode;	}	public void setCityCode(String cityCode) {		this.cityCode = cityCode;	}	public String getAreaCode() {		return areaCode;	}	public void setAreaCode(String areaCode) {		this.areaCode = areaCode;	}	@Override	public String toString() {		return ToStringBuilder.reflectionToString(this);	}}